<?php

namespace Tests\Unit;

use Tests\TestCase;

class StringLoveTest extends TestCase
{
    /**
     * A basic unit test example.
     *
     * @return void
     */
    public function testLoveStringFisrt()
    {
        $response = $this->json('POST', 'api/problem-3',
            [
                "input3"=>"aaaaaa"
            ]
        );
        $response->assertStatus(200);
        $response->assertJsonStructure([
            "best"
        ]);
        $response->assertJson([
            "best"=>12
        ]);
    }
    public function testLoveStringSeconds()
    {
        $response = $this->json('POST', 'api/problem-3',
            [
                "input3"=>"abcabcddd"
            ]
        );
        $response->assertStatus(200);
        $response->assertJsonStructure([
            "best"
        ]);
        $response->assertJson([
            "best"=>9
        ]);
    }
    public function testLoveStringThigth()
    {
        /**
         * tets of https://www.hackerrank.com/challenges/string-function-calculation/problem
         */
        $response = $this->json('POST', 'api/problem-3',
            [
                "input3"=>""
            ]
        );
        $response->assertStatus(200);
        $response->assertJsonStructure([
            "best"
        ]);
        $response->assertJson([
            "best"=>90000
        ]);
    }
}
